// From the office hours.
// import axios from "axios";
import React from "react";

const Profile = () => (
  <div>
    <br />
    <ul>
      <h1>Models</h1>
      <br />

      <h3>Models: Visit Coaching, SafeCare, Blurbs and Links</h3>
      <p>
        Whenever possible Resilience Visitation seeks to use evidence-based
        models as we work with families. 
      </p>
      <p>We use Mary Beyer’s <a href="https://www.visitcoachingcommunity.com/about"> Visit Coaching </a>
        model to facilitate most of our visits. This model includes:</p>
      <li>
        Helping parents articulate their children's needs to be met in visits
      </li>
      <li>Preparing parents for their children's reactions</li>
      <li>
        Helping parents plan to give their children their full attention at each
        visit
      </li>
      <li>
        Helping parents cope with their feelings so that they can visit
        consistently and keep their anger and sadness out of the visit
      </li>
      <br />
      <p>
        Visit Coaching is adaptable to many different situations and allows us
        to flexibility to meet each family’s unique needs while providing the
        support parents need to remain attuned to their children’s needs in
        extraordinarily stressful circumstances.{" "}
      </p>

      <br />
      <img src="pic/04.jpg" style={{ width: "80%" }} />
      <br />
      <br />
      <br />
      <h2>Sadly at this time we are unable to take on any more clients. </h2>
    </ul>
  </div>
);

export default Profile;

